import "./HomePage.css";
import { Link } from "react-router-dom";
import gif from "../images/abstract-open-space.gif";
// import "../fonts/BinggraeTaom.otf";

function HomePage() {
  return (
    <>
      <h1 className="title">
        <span id="first-row">
          {/* <span id="first-row" className="bingre"> */}
          <span id="bingo-txt">빙고</span>로 알아보는
        </span>
        <br />
        <span>나의 </span>
        <span id="accent-txt">
          <span id="real-txt">진짜 </span>
          <span id="mbti-txt">MBTI</span>!
        </span>
      </h1>
      <div className="heroheader">
        {/* 왜 1300px 으로 하면 나머지 요소들이 찌그러지는지? 가로폭 이미지로 꽉 채우려면 어떻게 해야 하는지? */}
        <img src={gif} alt="heroheader" width="100%" />
      </div>
      {/* <button className="btn">Call to action</button> */}
      <div className="btn-container">
        <Link to={"/profile"} className="btn">
          시작하기
        </Link>
      </div>
    </>
  );
}

export default HomePage;
